const RecipeList = ({ recipes }) => {
  return (
    <div>
      <h1>Recipe List</h1>
      {recipes.length > 0 ? (
        <ul>
          {recipes.map((recipe) => (
            <li key={recipe.id}>
              <img src={recipe.image} alt="food img" />
              <h3>{recipe.title}</h3>
              <p>Provided by Spoonacular </p>
              <p>{recipe.summary}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>No recipes found.</p>
      )}
      <div className="ButtonContainer">
        <button>Detail</button>
        <button>RecipUrl</button>
      </div>
    </div>
  );
};

export default RecipeList;
